import React, { Component } from "react";
import { isAuth, signout } from "../../actions/auth";
import { Breadcrumb, Icon, Row, Col, Layout, Card, Carousel, Button, Divider } from "antd";
// import { fetchProfiles } from "../../redux/actions/dashboardAction";
import { connect } from "react-redux";
import Input from "../Common/Input";
import { Router } from "express";
class Navbar extends Component {
  logoutHandler = () => {};
  render() {
    return (
      <Layout className="navbar">
        <Row>
          <Col span={24} md={24} xs={24}>
            <Row className="p-10">
              <Col span={4} md={4} xs={0}>
                {isAuth() && <div onClick={() => signout(() => Router.push("/signin"))}>Signout</div>}
              </Col>
              <Col span={8} md={8} xs={24}>
                <div className="search-area">
                  <Input placeholder="Search" />
                </div>
              </Col>
            </Row>
          </Col>
        </Row>
        {this.props.children}
      </Layout>
    );
  }
}
const mapStateToProps = (state) => {
  return {
    users: state.profiles,
  };
};
function mapDispatchToProps(dispatch) {
  //   return {
  //     fetchProfiles: data => {
  //       dispatch(fetchProfiles(data));
  //     }
  //   };
}
export default connect(mapStateToProps, mapDispatchToProps)(Navbar);
